(4, 0, 'หน่วยที่ 4. การช่วยฟื้นคืนชีพขั้นพื้นฐาน (CPR) และการใช้เครื่องกระตุกหัวใจด้วยไฟฟ้า (AED)', '2019-11-23 14:39:10'),
