INSERT INTO `exam_answer` (`id`, `exam_question_id`, `answers`, `correctness`, `created_at`) VALUES
(1, 1, 'การบาดเจ็บเนื่องจากอุบัติเหตุบนท้องถนนเท่านั้น', 0, '2019-11-23 15:17:22'),
(2, 1, 'อาการเจ็บป่วยเรื้อรัง เช่น เบาหวาน ความดันโลหิตสูง', 0, '2019-11-23 15:17:22'),
(3, 1, 'อาการที่แสดงให้เห็นเฉพาะการบาดเจ็บที่ชัดเจน เช่น มีเลือดออกรุนแรง ', 0, '2019-11-23 15:17:22'),
(4, 1, 'การได้รับบาดเจ็บหรือมีการเจ็บป่วยกะทันหันที่มีผลต่อชีวิตหรือการทำงานของอวัยวะในร่างกาย', 1, '2019-11-23 15:17:22'),
(5, 2, 'มานะถูกรถกระบะขนกระหล่ำปลีชนกระเด็น ขณะที่ไม่ข้ามถนนบนทางม้าลาย', 0, '2019-11-23 15:17:22'),
(6, 2, 'แม่ของมานีช็อคหมดสติ ภายหลังทำงานเก็บชากลางแจ้งติดต่อกันหลายชั่วโมง', 0, '2019-11-23 15:17:22'),
(7, 2, 'ปิติเป็นโรคกระเพาะอาหารอักเสบเรื้อรัง ไม่หายสักที ต้องไปพบแพทย์เป็นประจำ', 1, '2019-11-23 15:17:22'),
(8, 2, 'ปู่ของชูใจมีอาการปากเบี้ยว แขนขาอ่อนแรง วันนี้ไม่ได้พกยาหอม ยาดมมาด้วย', 0, '2019-11-23 15:17:22'),
(9, 3, 'สิ่งแปลกปลอมอุดตันทางเดินหายใจ, เจ็บแผลที่ปลายนิ้ว, ช็อคหมดสติ', 0, '2019-11-23 15:17:22'),
(10, 3, 'หายใจไม่ออก หน้าเขียว, วิงเวียน คลื่นไส้เมารถ, ตกเลือด', 0, '2019-11-23 15:17:22'),
(11, 3, 'ชักเกร็ง, ปากเบี้ยว แขนขาอ่อนแรง, เกร็งตัวเมื่อโกรธ', 0, '2019-11-23 15:17:22'),
(12, 3, 'ปวดท้องรุนแรง, เจ็บท้องคลอด, เจ็บหน้าอก', 1, '2019-11-23 15:17:22'),
(13, 4, ' เพื่อการแบ่งจำนวนผู้ป่วยฉุกเฉินให้ชุดปฏิบัติการฉุกเฉินบนรถพยาบาลฉุกเฉินทำงานเท่าๆ กัน ', 0, '2019-11-23 15:17:22'),
(14, 4, 'เพื่อสั่งการรถพยาบาลฉุกเฉินที่มีความพร้อมให้ตรงกับลักษณะอาการผู้ป่วย', 1, '2019-11-23 15:17:22'),
(15, 4, 'เป็นข้อมูลพื้นฐานของจังหวัดเท่านั้น แต่การสั่งการรถพยาบาลฉุกเฉินขึ้นอยู่กับหน่วยที่อยู่ใกล้ที่สุด', 0, '2019-11-23 15:17:22'),
(16, 4, 'ถูกทุกข้อ', 0, '2019-11-23 15:17:22'),
(17, 5, 'ผู้ป่วยที่ได้รับบาดเจ็บหรือมีการเจ็บป่วยกะทันหันที่มีผลต่อชีวิตหรือการทำงานของอวัยวะในร่างกาย', 0, '2019-11-23 15:17:22'),
(18, 5, 'ผู้ป่วยที่ต้องได้รับการช่วยเหลือจากแพทย์ทันที ที่เจ็บป่วยในระบบการหายใจ ระบบไหลเวียนเลือด', 0, '2019-11-23 15:17:22'),
(19, 5, 'ผู้ป่วยที่มีลักษณะอาการ เช่น ไม่สามารถหายใจได้ปกติ หายใจเร็ว แรงและลึก หายใจมีเสียงดังผิดปกติ', 0, '2019-11-23 15:17:22'),
(20, 5, 'ถูกทุกข้อ', 1, '2019-11-23 19:36:20'),
(21, 6, 'อาการหัวใจเต้นแรง ตื่นเต้น เพื่อนเรียกหลายครั้งไม่ได้ยิน ตกในพะวงเมื่อพบดาราเกาหลี', 1, '2019-11-23 15:17:22'),
(22, 6, 'หายใจเร็ว แรงและลึก เสียงดังผิดปกติ หน้าเขียวคล้ำ หลังอมลูกอมที่เพื่อนซื้อมาฝากจากเกาหลี', 0, '2019-11-23 15:17:22'),
(23, 6, 'ตัวเย็นและซีด เหงื่อแตกจนท่วมตัว วูบเมื่อลุกขึ้นยืนและหมดสติไป ขณะที่ดูซีรี่ย์เกาหลี', 0, '2019-11-23 15:17:22'),
(24, 6, 'เป็นผู้ป่วยฉุกเฉินวิกฤตทุกข้อ', 0, '2019-11-23 15:17:22'),
(25, 7, 'ตั้งสติและโทรแจ้ง 191 ก่อน เพราะตำรวจมีหน้าที่ดูแลประชาชน', 0, '2019-11-23 15:17:22'),
(26, 7, 'ยืนสังเกตอาการไปก่อน เพราะอาจกลับมาหายได้ ไม่อยากให้เสียเวลาคนเอื่น', 0, '2019-11-23 15:17:22'),
(27, 7, 'สังเกตอาการและสิ่งต่างๆ รอบตัวเท่าที่ทำได้ แล้วโทรแจ้ง 1669', 1, '2019-11-23 15:17:22'),
(28, 7, 'จับประคองตัวพิงผนังบ้าน รอแม่ที่เป็นพยาบาลกลับมาก่อน ', 0, '2019-11-23 15:17:22'),
(29, 8, 'ระดับฉุกเฉิน เพราะแค่น้ำในโอ่งที่บ้านไม่น่าทำให้เสียชีวิตได้ และมีคนฝึกอบรมกู้ชีพมา ช่วยได้แน่นอน', 0, '2019-11-23 15:17:22'),
(30, 8, 'ระดับฉุกเฉินวิกฤต เพราะมีคนตื่นตกใจ โวยวาย และคนมุงดูค่อนข้างมาก\r\n', 0, '2019-11-23 15:17:22'),
(31, 8, 'ระดับฉุกเฉินเร่งด่วน เพราะจำเป็นอย่างเร่งด่วนมากที่ต้องช่วยเหลือ', 0, '2019-11-23 15:17:22'),
(32, 8, 'ระดับฉุกเฉินวิกฤต เพราะเมื่อเขย่าไม่รู้สึกตัวและหมดสติ', 1, '2019-11-23 19:36:45'),
(33, 9, ' มีสติ รู้เบอร์โทรแจ้งเหตุการแพทย์ฉุกเฉิน สังเกตอาการและสถานการณ์แวดล้อมรอบตัว', 1, '2019-11-23 15:17:22'),
(34, 9, 'มีสติ แบ่งระดับความรุนแรงให้ได้ แจ้งไปที่นายก อบต.', 0, '2019-11-23 15:17:22'),
(35, 9, 'มีสติ สังเกตอาการ แบ่งระดับความรุนแรงให้ได้ รู้เบอร์โทรแจ้งเหตุการแพทย์ฉุกเฉิน', 0, '2019-11-23 15:17:22'),
(36, 9, 'มีสติ รู้เบอร์โทรแจ้งเหตุการแพทย์ฉุกเฉิน และแจ้งเหตุโดยให้คนอื่นบอกอาการแทน', 0, '2019-11-23 15:17:22'),
